contract Empresas {
    
    struct Empresa{
        uint IdEmpresa;
        string name;
        string description;
    }

    Empresa [] public empresas;

    function addEmpresa() public{
        empresas.push( Empresa(1, "nombre", "descripcion"));
    }

    function getEmpresaById() public view returns (uint){
        return 1;
    }

}

